import React from 'react';
import ProductList from './ProductList';
import './style.css';

function App() {
  const addToCart = (product) => {
    console.log(`${product.name} added to cart`);
  };

  return (
    <div className="App">
      <header className="App-header">
        <ProductList addToCart={addToCart} />
      </header>
    </div>
  );
}

export default App;
